import { io } from "socket.io-client";
const URL = "http://localhost:8080";

const socket = io(URL, { autoConnect: false});
socket.on("connect", ()=>{
  console.log("Conneced")
})

socket.onAny((event, ...args) => {
  console.log(event, args);
});

export default socket;
